import React from 'react';
import AskNed from './../../../assets/images/profile_images/AskNed.jpeg'
import Notifications from "react-notifications-menu"

const data = [
    {
        image: AskNed,
        message: 'AskNed has accepted your request',
        detailPage: '/',
    },
    {
        image: './../../../assets/images/logo_images/DarkLogoText.png',
        message: 'You have matched with BottleUp',
        detailPage: '/',
    },
]

const NotificationButton = ({
    className,
    ...props
  }) => {
    return (
        <Notifications         
            data={data} 
            markAsRead={data => console.log(data)}
            header={
                {
                  title: 'Notifications',
                  option: { text: 'See All Notifications', onClick: () => {} }
                }
              }
            />

    );
        }

  export default NotificationButton;
